import React, { useReducer } from 'react';
type StateType = {
    count
}

const Counter = () => {
    const initialState = {
        count: 0
    }

    const reducer = (state, action) => {
        switch(action.type){
            case 'INCREMENT':
                return {
                    count: state.count + action.payload
                }
            case 'DECREMENT':
                return {
                    count: state.count - action.payload
                }
            default: return state    
        }
    }


    return (
        <div>
            <h3>React Counter</h3>
        </div>
    );
};

export default Counter;
